import React, { useState, useRef } from "react";
import "../css/Contact.css";
import axios from "axios";
import ReCAPTCHA from "react-google-recaptcha";
let key = "6LcgdO4iAAAAAEWOAdDHI-N8cLOiSJKvQ_8ChOuY";

function SocialMedia(props) {
  return (
    <a href={props.link} target="_blank">
      <iconify-icon
        icon={props.id}
        width="35"
        height="35"
      ></iconify-icon>
    </a>
  );
}


function Contact() {

let reRef = useRef();

  let [fullName, setFullName] = useState("");
  let [email, setEmail] = useState("");
  let [phone, setPhone] = useState("");
  let [company, setCompany] = useState("");
  let [message, setMessage] = useState("");
  let [sent, setSent] = useState(false);

  let resetForm = () => {
    setFullName("");
    setEmail("");
    setPhone("");
    setCompany("");
    setMessage("");
    setTimeout(() => {
      setSent(false);
    }, 5000);
  };

  let handleSubmit = async (e) => {

    const token = await reRef.current.executeAsync();
    console.log(token)

    e.preventDefault();
    let data = {
      name: fullName,
      email: email,
      phone: phone,
      company: company,
      message: message,
      token: token
    };
    axios.post("/api/email", data).catch((e) => {
      console.log(e);
    });
    setSent(true);
    resetForm();
  };

  return (
    <div className="contact-page-container">
      <div className="contact-page-head">
        <iconify-icon
          icon="line-md:check-list-3"
          width="125"
          height="125"
        ></iconify-icon>
        <h1>So I've checked your boxes</h1>
        <p>
          Have an interesting project idea, or think I'd make a good addition to
          your development team? Get in touch, and let's talk about how we can
          work together!
        </p>
      </div>
      <ReCAPTCHA sitekey={key} size="invisible" ref={reRef} />
      <div className="contact-container">
        <div className="email-container">
          <form onSubmit={handleSubmit}>
            <input
              type="text"
              name="name"
              id="name"
              placeholder="Your name"
              onChange={(e) => setFullName(e.target.value)}
              value={fullName}
            />
            <br />
            <input
              type="email"
              name="email"
              id="email"
              placeholder="Email"
              onChange={(e) => setEmail(e.target.value)}
              value={email}
              required
            />
            <br />
            <input
              type="tel"
              name="phone"
              id="phone"
              placeholder="Phone"
              onChange={(e) => setPhone(e.target.value)}
              value={phone}
            />
            <br />
            <input
              type="text"
              name="company"
              id="company"
              placeholder="Company"
              onChange={(e) => setCompany(e.target.value)}
              value={company}
            />
            <br />
            <textarea
              name="message"
              id="message"
              cols="30"
              rows="2"
              placeholder="Message"
              onChange={(e) => setMessage(e.target.value)}
              value={message}
            ></textarea>
            <br />
            <button type="submit">Send</button>
            <div className={`${sent ? "email-sent" : "hidden"}`}>
              Your message has been recieved!
            </div>
          </form>
        </div>
        <div className="social-media-container">
          <p>Or, find me on:</p>
          <div className="social-media">
            <SocialMedia
              link="https://www.facebook.com/devonfromfl"
              id="entypo-social:facebook"
            />
            <SocialMedia
              link="https://www.instagram.com/adventures.of.dev/"
              id="akar-icons:instagram-fill"
            />
            <SocialMedia
              link="https://twitter.com/realDevonMartin"
              id="entypo-social:twitter"
            />
            <SocialMedia
              link="https://www.linkedin.com/in/real-devon-martin/"
              id="entypo-social:linkedin"
            />
            <SocialMedia
              link="https://github.com/DevonMartin"
              id="akar-icons:github-fill"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
